    [],nt"num_tags": 3,nt"name": "defining-the-coupled-effects-of-cryogenic-space-radiation-and-hypervelocity-impact-damamge",nt"isopen":
    true,nt"url": null,nt"notes": "The objective of the research proposed herein
    is to define the coupledn(combined) effect of critical environments on the structural
    performancenof composite overwrap pressure vessels (COPV).  The three environmentsnthat
    will be coupled are cryogenic temperature, space irradiation, andnhypervelocity
    (micrometeoroid/space debris) impact.  HyPerCompnEngineering (HEI) have previously
    conducted research that studied  thenindependent effects of the three environments
    on COPV structuralnperformance.  Prior research determined that COPV structural
    performancenand capabilities were significantly degraded by each of thenenvironments.
     Clearly, a space-based cryogenic fuel storage vesselnwould be exposed to all three
    environments simultaneously.  Therefore,nit is of interest to study the coupled
    effects of the environments,ndetermine the coupled effect, and define design allowables
    that considernthe simultaneous effect.  The result will be a safer and more reliablenCOPV
    design.  Note, the research proposed herein is applicable anynspace-based composite
    structure and earth-based COPV",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
